export default function Playingcard(props){

  const bIArray = props.backgroundImage
  
  
  const backgroundImageArray = (props.backgroundImage).map(item => {
    return(
      {backgroundImage: `url(${item})`}
    )
  })

  console.log(backgroundImageArray[0])

  const backgroundImageTemp = {
    backgroundImage: `url(${props.backgroundImage[0]})`
    }

  return(
    <div className="playingcardwidget">
      <div className="card-group">
        <div className ="big-card card" href={props.card1} styles={backgroundImageTemp}>
          <h3>Marriage</h3>
        </div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card2}>
          <h3>Photos de Famille</h3>
        </div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card3}>
          <h3>Grossesse</h3>
        </div>
        <div className ="little-card card"></div>
        <div className ="big-card card" href={props.card4}>
          <h3>Portraits</h3>
        </div>
        <div className ="little-card card"></div>
      </div>
    </div>
  )
}
